    "2016-04-19T02:29:20.401185",nt"name": "2013-ecad-multi-family-energy-audit-and-eui-data",nt"isopen":
    false,nt"url": null,nt"notes": "The following information will allow you
    to understand the intent of data provided.  This report is in conjunction with Austin
    City Code 6-7u2019s Energy Conservation Audit and Disclosure Ordinance approved
    in November 2008 (amended in April 2011) to improve the energy efficiency of homes
    and buildings that receive electricity from Austin Energy. The ordinance meets one
    of the primary goals of the Austin Climate Protection Plan which is to offset 800
    megawatts of peak energy demand by 2020 to help reduce Austin's carbon footprint.
     In addition, this report contains information on multi-family properties older
    than 10 years that are required to perform an energy audit and report the results
    to the City of Austin and all residents living in those communities. The Austin
    Energy report quantifies the 2013 energy efficiency findings and the progress towards
    meeting City Council goals of Resolution 20081106-048.",nt"license_title":
